  false,\n\t\"url\": null,\n\t\"notes\": \"NCEI Accession 0084620 includes discrete
  sample and profile data collected from METEOR in the Aegean Sea, Mediterranean Sea,
  Mediterranean Sea - Eastern Basin, Mediterranean Sea - Western Basin and Tyrrhenian
  Sea from 2001-10-18 to 2001-11-11. These data include CHLOROFLUOROCARBON-11 (CFC-11),
  CHLOROFLUOROCARBON-113 (CFC-113), CHLOROFLUOROCARBON-12 (CFC-12), DELTA HELIUM-3,
  DISSOLVED INORGANIC CARBON (DIC), DISSOLVED OXYGEN, HELIUM, HYDROSTATIC PRESSURE,
  NEON, NITRATE, Potential temperature (theta), SALINITY, TOTAL ALKALINITY (TA), Tritium
  (Hydrogen isotope), WATER TEMPERATURE, phosphate and silicate. The instruments used
  to collect these data include CTD and bottle.nnThese data were collected by B. Schneider
  of Commonwealth Scientific and Industrial Research Organization and W. Roether [affiliation
  unknown] as part of the CARINA/06MT20011018 data set. CDIAC assigned the following
  cruise ID(s) to this data set: CARINA/06MT20011018.nnThe Global Coastal Carbon Data
  Project data includes the bottle (discrete) and surface (underway) carbon-related
  measurements from coastal research cruises, the data from time series cruises and
  coastal moorings. The coastal regions data are very important for the understanding
  of carbon cycle on the continental margins.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
